import React from 'react';

import Footer from '../Home/Footer/Footer';
import AppinmentMain from './Appointment/AppinmentMain';

const Appointment = () => {
    return (
        <div>
            <AppinmentMain/>
            <Footer/>
        </div>
    );
};

export default Appointment;
